- input: "TEXT\x1CC00009985\x1C29572475\x1C\x1CF3XN\x1CPlease note that the disbursement
    to the connected organization has been reported as an in-kind contribution to
    pay for food and drinks at a fundraising event for Sen. Blanche Lincoln. Although
    NABPAC recognizes that a connected organization of an SSF may not pay for any
    part of a fundraising event, and thus should not be reimbursed by the SSF, this
    was the only way to fully disclose the activity for this event. Another member
    of the connected organization had mistakenly paid for the SSF's fundraising event
    with the connected organization's credit card before the event took place, because
    the connected organization had its own event (not a fundraiser) at the same location
    after the fundraiser ended. The connected organization had to pay for all costs
    of both events up front. Please take this information into consideration. Thank
    you.\n"
